import{_get as t}from"../_modules/get/get.min.js";async function getScoutRanks(){let e=document.getElementById("viewScoutsButton");e.innerText="Requesting Data...",t("/api/v1/points/all",e.id).then(t=>{for(var n="",o=0;o<t.length;o++)n+=`<tr><td><p>${t[o].username} (${t[o].team})</p></td><td>${Math.round(t[o].score)}</td></tr>`;document.getElementById("preInsert").insertAdjacentHTML("afterend",n),document.getElementById("eventCodeDisplay").innerText="Top scouts",e.innerText="Reload Data"}).catch(t=>console.log(t))}document.body.onload=getScoutRanks;